import React from 'react';
import s from './Teams.module.css';
import  Team  from './Team/Team';
 
const TITLE = 'Команды лиги Championship';

const Teams = (props) => {



let ListTeams=props.Data.map(item => ( 
               < Team team_id={item.team_key} team_name={item.team_name}/> ));  


  if (this.props.match && this.props.match.params.league_id) {
    const league_id = this.props.match.params.postID
      fetch(`http://127.0.0.1:8000/api/${league_id}`)
      .then(res => {
        this.setState({
          post: res.data
        });
      })
    }


	return(
	 <div >
           <ul>
             <h1>{TITLE}</h1>
             <div>this</div>
            
             { ListTeams }
          </ul>
        </div>)
			
}

export default Teams;
